        public static string GetSiteName()
        {
            var cacheHelper = ObjectFactory.GetInstance<ICacheHelper>();
            var appSettings = cacheHelper.GetAppSettings(AppSettingType.SiteData);

            var data = appSettings.FirstOrDefault(i => i.Name == "SiteName")
                ?? new AppSetting();

            return !string.IsNullOrWhiteSpace(data.Value) ? data.Value : "SamSun Vina";
        }

        public static string GetSiteLogoImageName()
        {
            var cacheHelper = ObjectFactory.GetInstance<ICacheHelper>();
            var appSettings = cacheHelper.GetAppSettings(AppSettingType.SiteData);

            var data = appSettings.FirstOrDefault(i => i.Name == ConstKeys.SiteLogoImagePath)
                ?? new AppSetting();

            return !string.IsNullOrWhiteSpace(data.Value) ? data.Value : string.Empty;
        }

        public static string GetDefaultDisplayLanguage()
        {
            return GetSiteStyleSettings(ConstKeys.DefaultDisplayLanguage);
        }

        public static List<string> GetLanguageOrder()
        {
            var defaultLang = GetDefaultDisplayLanguage();
            var list = new List<string>
            {
                defaultLang
            };

            list.AddRange(LanguageList().Where(i => i.Value != defaultLang).Select(i => i.Value));

            return list;
        }

