        public static string GetAdminEmailNotification()
        {
            var cacheHelper = ObjectFactory.GetInstance<ICacheHelper>();
            var smtpDb = cacheHelper.GetAppSettings(AppSettingType.EmailSettings);
            var emailNotification = smtpDb.FirstOrDefault(x => x.Name == ConstKeys.EmailNotification)
                ?? new AppSetting();

            return emailNotification.Value;
        }

        public static string GetAdminNotifyLanguage()
        {
            var cacheHelper = ObjectFactory.GetInstance<ICacheHelper>();
            var smtpDb = cacheHelper.GetAppSettings(AppSettingType.EmailSettings);
            var data = smtpDb.FirstOrDefault(x => x.Name == ConstKeys.AdminNotifyLanguage)
                ?? new AppSetting();

            if (string.IsNullOrWhiteSpace(data.Value) || !LanguageCodeIsValid(data.Value)) return "en-US";

            return data.Value;
        }

        public static List<TextValueModel> GetStates()
        {
            var cacheHelper = ObjectFactory.GetInstance<ICacheHelper>();
            var list = cacheHelper.GetAppSettings(AppSettingType.State);
            var listResult = new List<TextValueModel>();

            list.ForEach(i => listResult.Add(new TextValueModel
            {
                Text = i.Name,
                Value = i.Value
            }));

            return listResult;
        }

        public static string GetStateName(string value)
        {
            return (GetStates().FirstOrDefault(i => i.Value == value) ?? new TextValueModel()).Text;
        }

