                }
            };
        }

        public static string GetHttp()
        {
            var cacheHelper = ObjectFactory.GetInstance<ICacheHelper>();
            var smtpDb = cacheHelper.GetAppSettings(AppSettingType.SiteData);

            var isHttps = smtpDb.FirstOrDefault(x => x.Name == ConstKeys.IsHttps)
                ?? new AppSetting();

            return isHttps.Value.ToBool() ? "https://" : "http://";
        }

